def processing():
    with open("20_core_run_time.txt", "r") as f:
        tracing_runs = []
        base_runs = []
        for counter, line in enumerate(f):
            # get the time length
            run_time = float(line.strip())
            # if even add to tracing runs, otherwise base runs
            if counter % 2 == 0:
                tracing_runs.append(run_time)
            else:
                base_runs.append(run_time)
        print(len(tracing_runs), len(base_runs))
        # print the average time for each run
        print("Average time for tracing runs: ", sum(tracing_runs) / len(tracing_runs))
        print("Average time for base runs: ", sum(base_runs) / len(base_runs))
        # get the two lists
        print(tracing_runs)
        print(base_runs)


